import React from "react";
import { StyledCardList } from "./card-list.styles";

export const CardList = props => {
  return <StyledCardList>    {monsters.map(monster => (
    <h1 key={monster.id}>{monster.name}</h1>
  ))}</StyledCardList>;
};
